  - name: TEXT4000
    number: '6'
    value: '1. The $5,371.97 was a transfer from our non-federal account to the federal
      account for an allowable allocation of expenses incurred on Schedule H4. However,
      due to new SCGOP staff a data entry error was made with the campaign finance
      software program and this receipt showed on Schedule A as opposed to Schedule
      H3, where it should have been disclosed. The staff has undergone training with
      the vendor to learn the software so as not to repeat this mistake in the future.
      2. The SCGOP has a 3-step process for collecting information from contributors.
      First, on every fundraising solicitation we ask for the contributors name, full
      address, occupation and employer on a reply card. Upon receiving a contribution,
      if any of the contributors information is missing we contact the contributor
      by telephone to ask for any missing information. If unsuccessful by telephone,
      within 30 days we mail a letter to the contributor asking for the missing information
      and include a business return envelope. If we do not receive a response from
      the letter within 7 days, we call them again to ask for the information. Finally,
      once a quarter, we mail any contributor whose information is incomplete that
      has given within that calendar quarter. 3. We have amended our report to further
      clarify the contributor information for Gentry, W.M., PBHE/CRNA, and US Government/Manager.
      4. The expenditures on Schedule H4, Line 21(a) for  ITEMIZE: health insurance,
      net pay and payroll taxes were for employees who spent less than 25% of their
      time during the month referenced on FEA or activities in connection with a federal
      election. During this month, staff was engaged in party building activities
      including a state convention and precinct reorganization, and was not engaged
      in activities in connection with a federal election. 5. The disbursements on
      Schedule H4 Line 21(a) for advertising and ITEMIZE: advertising were advertisement
      for party building activities, specifically local county party meetings and
      the state convention, which are required by state law. These newspaper advertisements
      did not mention a federal candidate and did not promote, attack, support or
      oppose a federal candidate. They included the date, time, location and contact
      phone number for the appropriate meetings or the state convention. 6. We have
      amended our report to clarify the disbursements for equipment rental, silver
      elephant event and Silver Elephant Event. 7. We have amended our report to clarify
      this discrepancy for Advanced Video and Ovations which should have categorized
      as Direct Fundraising expenses and not Administrative Expenses.  '
